<p> <img src="img/24.jpg" alt="渭南制鞋总公司"></p>

				
　　区委“以案为鉴、以案促改”警示教育大会召开后，昌平区交通局党组召开专题党组扩大会议，专题传达学习本次警示教育大会精神，向全体党组成员、处级、科级领导干部做了全面从严治党专题谈话和提醒。局党组书记袁丽民强调，全面从严治党永远在路上，对党员领导干部的监督会更深入、更严格，局各级领导干部要认真学习贯彻区警示教育大会精神，时刻绷紧纪律这根弦，做到严以律己、严以用权、以案为鉴，坚持自查自纠、全面正风肃纪，深刻分析问题原因，落实整改，举一反三，严格杜绝在主管领域失察失管，始终做到“慎独、慎微、慎始”。按照区警示教育大会部署要求，局党组对下一步推进全面从严治党工作进行了再动员、再部署。

