  <h3 align="center" class="mtitle">
 仙桃器材制造有限公司
  </h3>
   <!--来源和时间-->
  <div class="source">
   <div class="tip">
    <div class="l"> 来源：技术
     
     &nbsp;&nbsp;&nbsp;&nbsp;时间：2022-02-08 16:47

<p>仙桃器材制造有限公司mlj8d,桐城塑料有限公司,曲靖电气机械服务中心,三门峡羽毛服务中心,鹰潭卫浴总公司
	 <span style="font-size:30px;"></span>
<p> <img src="img/24.jpg" alt="仙桃器材制造有限公司"></p>
	   老一辈儿天津人都知道
1900年—1950年间
天津曾是中国第二大城市和华北最大的城市
同时期，不光享有超高的政治地位
经济水平也是让诸多城市难以望其项背
地位丝毫不输如今的北上广深


摄影师：甄琦

到了90年代
天津已成功跃居为
我国北方地区最大的工商业中心
不仅坐拥中国第二个国家级新区——滨海新区
北方最大的港口——天津港
还难能可贵的在自然资源、产业基础、
交通运输、开放开发等诸多方面几无短板
成为了环渤海经济圈 上的一颗璀璨明珠



进入21世纪
天津厚积薄发
成为北方地区经济发展的新引擎
2000~2016年
天津的GDP增长速度始终高于全国
高达13.63%的年均增速
更是大幅度领先于全国GDP的年均增速

大家都知道
工业是天津经济快速增长的核心驱动力
2000~2016年间
天津的工业增加值实现年均17.38%的增长速度
已经接近同时期全国年均增速的2倍
2004年更是高达26.5% 一骑绝尘
创造了让人叹为观止的城市成就


但近几年
天津的经济发展却反复被人诟病
2020年前三季度中国GDP50强城市
天津首次无缘前十


一时间，唱衰声四起：
“天津的综合实力连武汉、南京都赶不上！”
“天津根本不配做直辖市！”
“都跌出前10了，真的是完了”

可事实真的如此吗
答案是：并非如此！
我们都知道
人均收入、税收、存款、消费、环境等
才是反映一个城市综合实力的核心数据
GDP并不能完全代表城市的真实经济规模
也不能直观地反映城市的综合实力

摄影师：甄琦

而且，我们还要知道
各地的GDP核算尺度是不一样的
这也就造成了榜单的排名
其实并不具有权威的参考性
天津的基础核心数据
其实还是在全国前10之内的

接下来我们来对比两组数据
大家就能更直观地看到天津的实力了

这些才是硬指标

首先来看下三个城市的国内税收：天津市为3460.07亿元、南京市2730.58亿元、武汉市2673.28亿元。这个是不包括海关代征和进口税收的，基本是属于国内企业的创收，所以和经济实力还是正相关的。从数据来看，天津市的税收实力远高于其他两城！


摄影师：甄琦

其次是三个城市的资金总量，三个城市的金融机构本外币存款余额分别是：天津31788.78亿元、南京35218.76亿元、武汉28136.35亿元。

这是城市创造的财富积累，虽然天津市在近些年增长偏慢但实力还是尚存的！天津要足足高出武汉市几千亿元，足以说明天津的经济底蕴还是非常雄厚的，企业、居民和政府的财力还是要比武汉市更为充足的，产业产出的财富积累也更多。


摄影师：甄琦

综上所述，天津的经济实力还是不容小觑的！唯GDP就简单定论天津的综合实力是非常不专业的。

*因为2020年疫情的关系，所以各地数据偏差较大，尤其是武汉市，所以特此采用2019年时的税收、金融机构本外币存贷款余额等指标来比照。


天津的综合实力有多强
这些都是最好的证据

四个“顶级头衔”，天津占了三席

中国城市有四大“顶级头衔”
分别为经济特区、国家级新区、
自贸区、国家中心城市
而我天津占了3个



国家级新区



从1992年上海浦东新区开始，国家已先后批复设立了19个国家级新区。天津是第二个，也就是滨海新区，2006年5月26日正式批复，2010年1月11日正式挂牌，成为国家重点支持开发的区域。




自贸区



目前国家共设立了12个自贸试验区，天津是北方首个自贸区。




国家中心城市



所谓国家中心城市，是中国城镇体系规划设置的最高层级，一旦被确认为国家中心城市，就意味着从国家层面对该城市发展定位的认可。目前，我国已有9座城市获此殊荣，我大天津在列。

国家中心城市分布图



天津是全国唯一一个“双先导区”

2020年天津西青区获批国家级车联网先导区；今年2月19日，天津滨海新区又入列工信部发布的第二批国家人工智能创新应用先导区名单。至此，我市成为目前为止国内唯一一个拥有双先导区的省市。





天津人工智能发展全国第10

根据《中国城市人工智能发展指数报告(2020)》显示，天津市人工智能发展总指数为73.08，在全国位列第10位！

2020年，全市智能科技产业营业收入占规上工业和限额以上信息服务业比重达23.6%，成为天津高质量发展的重要引擎！





天津是中国最具投资潜力城市

现今，天津是中国大陆最佳商业城市、中国最具投资潜力城市。截止2019年7月底，外商投资企业达到1.5万家，累计实际利用外资1795亿美元，世界500强企业达到249家，成功跻身外商投资的重要聚集地和回报率最高的地区之一，外资企业创造了全市税收的31%。


交好的国际友好城市遍布49个国家的89个地区，如今天津还是世界智能大会、中国国际矿业大会的永久举办地、夏季达沃斯论坛永久举办城市之一。





不光是经济发展
天津这座城还藏着太多太多的惊喜

除了经济发展这些硬指标
天津的地标、人文、教育、美食
也都格外出挑
放眼全国也是一张张金字招牌


天津是名副其实的学府之城

天津有57所国家承认的高等院校
本科院校更是多达32所




中国第一所现代大学——天津大学
周恩来总理的母校——南开大学
纺织科学与工程全国第一的天津工业大学
中国唯一一所异地办学的211大学——河北工业大学
都是天津名震全国的教育学府




天津坐拥非常多的全国之最全国最大的邮轮母港——天津港摄影师：甄琦中国为数不多免费开放的国家级5A景区古文化街摄影师：张明贺世界唯一一座桥上摩天轮——天津之眼摄影师：仲保岩全世界规模最大的海洋博物馆国家海洋博物馆摄影师：张乔世界最高妈祖圣像——滨海妈祖世界上个人建造面积最大的藏石园中华石园摄影师：郑精彩世界上唯一一座“水中之塔”——天塔摄影师：楼晋瑜中国近代教育史上的第一所大学——天津大学摄影师：北洋光影中国唯一一家拥有专属博物馆的豪华酒店天津利顺德大饭店目前世界上最大的天然灵壁石人造石林
天津宝成奇石园



目前国内最长的步行街
滨江道+和平路步行街

摄影师：枉言


这些地标是天津的历史的见证者天津站是闻名全世界的百年车站


摄影师：枉言

意式风情区
是亚洲唯一一处具有意大利风格的大型建筑群


摄影师：枉言

解放桥
是全国唯一一座立转式开启桥



五大道
是迄今全国保留最为完整的洋楼建筑群


摄影师：枉言

天津滨海新区图书馆
是全世界都当仁不让的最美图书馆



西开教堂
是天津市最大的罗马式建筑，超级壮观



瓷房子
是价值98亿的中国古瓷博物馆

摄影师：小红书炸小猪排叭

天津周大福金融中心
是中国第四高楼、全球第八高楼



梨木台——天津的神农架天津水上公园，坐享“北方小西子”之称

天津东疆湾景区是我国最大的人造沙滩景区



天津南湖景区
有“津京旅游第一岛”的美誉



这些天津爱好铸造了接地气的城市氛围在天津，有种全民爱好叫相声在天津，有种茶余饭后的消遣叫砸六家在天津有种让人啼笑皆非的误解叫天津人都会打快板在天津，有种独家的娱乐项目叫海河高台跳水在天津，有种魅力四射的舞蹈叫吉特巴在天津有种深受本地老炮儿喜爱的运动叫摔跤在天津，有种冬日的奇观叫海河冬泳在天津有与苏州桃花坞年画并称“南桃北柳”的杨柳青年画在天津，有种传承百年的非遗文化叫风筝魏
天津地道美食，是这座城的灵魂到了天津，这些美味可千万不能错过个顶个儿肥美的海鲜皮皮虾、大螃蟹、蛏子、小龙虾···每年开海季，敞开了吃，100%管够
还有独得天津人恩宠的煎饼果子



蜚声中外的天津三绝
十八街麻花、狗不理包子、耳朵眼炸糕




软糯可口的小宝栗子

逢年过节必上桌的饺子和捞面

骨焦肉嫩的津菜扛把子罾蹦鲤鱼


饭桌必备的二厂火腿、天宝楼酱货


鲜脆爽口的水爆肚

皮薄酥脆、馅料丰富的锅贴



清凉舒爽的天津刨冰

酸甜可口的大糖堆儿、糖粘子

还有熟梨糕、杨村糕干、白皮儿、
麻酱、油酥烧饼、大饼卷一切、卷圈、
羊汤、嘎巴菜、面茶、津味素饺子…
分分钟收买你的胃


这样有实力又有颜值的天津
怎能不让人一眼万年呢？

若您也是天津人
请把这篇文章速速发出去
让所有人都看到咱天津的精彩和骄傲
— END —


	  
