  <h3 align="center" class="mtitle">
 长春挖掘机总公司
  </h3>
   <!--来源和时间-->
  <div class="source">
   <div class="tip">
    <div class="l"> 来源：技术
     
     &nbsp;&nbsp;&nbsp;&nbsp;时间：2022-02-08 16:46

<p>长春挖掘机总公司j34jo,益阳水果批发经销部,西安石材营运部,衢州金属制造营运部,镇江纺织业营运部
	 <span style="font-size:30px;"></span>
<p> <img src="img/24.jpg" alt="长春挖掘机总公司"></p>

				
　　本报讯 （记者 陈华永）近日，工业和信息化部公布第三批工业产品绿色设计示范企业名单，全国共有117家企业通过评审。由贵州省工业和信息化厅推荐的企业中，贵州泰永长征技术股份有限公司和贵州川恒化工股份有限公司两家企业上榜。

　　据贵州省工业和信息化厅相关负责人介绍，绿色设计是按照生命周期理念，在产品设计开发阶段系统考虑原材料选用、生产、流通、使用、回收和处理等各个环节对资源和环境造成的影响，力求在产品全生命周期中最大限度降低资源能源消耗，尽可能少用和不用有害原料，从而实现减污降碳、绿色循环发展的活动。

　　工信部遴选工业产品绿色设计示范企业，旨在聚焦生态环境影响大、消费需求旺盛、对产业链供应链有重要影响的工业产品领域，遴选一批绿色设计基础好、创新能力强、品牌和市场影响力大的绿色设计示范企业，提升行业绿色低碳发展意识，加大绿色产品供给，引领和带动绿色消费。

　　下一步，贵州将认真贯彻落实中央的决策部署和省委的工作安排，紧扣碳达峰碳中和目标，充分发挥绿色先进典型的引领作用，强化数字化智能化绿色化融合，构建高效、清洁、低碳、循环的绿色制造体系。同时，深入实施绿色制造专项行动，支持企业全面提升工业产品的绿色设计能力，开发绿色产品，建设绿色工厂，推动创建绿色供应链，持续打造绿色工业园区，强化数据中心绿色设计。

　　来源：贵州日报






